import { Link } from "react-router-dom";
import React from "react";

const Navbar=()=>{
    return(
        <header>
        <div className="container">
            <Link to ='/'>
                <h1>Todo App</h1>
            </Link>
        <nav>
            <div>
                <Link to='/login'>Login</Link>
                <Link to='/signup'>Signup</Link>
            </div>
        </nav>
        </div>
        </header>
    )
}
export default Navbar;
